  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Swan River
  National Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar
  year. The report begins with Refuge highlights and information about climatic and
  habitat conditions, administration, funding, and technical assistance. Habitat management
  is covered; forests and water rights are discussed. The wildlife section of the
  report discusses endangered and threatened species, migratory birds, mammals, and
  non-migratory birds. Interpretation and recreation activities are outlined; topics
  include information and interpretation, recreation, and law enforcement. Cooperative
  programs and items of interest are discussed. Photographs are attached.\",\n\t\"license_title\":
